import Intervalo_de_confianza from './intervalo_confianza'
import Result from "./result";
import { useState,useEffect } from 'react';
export default function Inicio() {
  const [n, setn] = useState('');


  useEffect(() => {
    const Elementn = document.getElementById('N');
  }, []);
  if(Elementn !== NULL){
    Elementn.addEventListener('change', updateValue);
  }

  function updateValue(e) {
    setn(e.target.value)
  }
  return (
    <div style={{ display: "flex", justifyContent: "space-evenly", alignContent: "center", margin: "5%" }}>
      <Intervalo_de_confianza />
      <Result result={n} />
    </div>
  );
}
